from datetime import datetime, timezone
from types import SimpleNamespace

import pytest

from scripts import rebuild_positions as rp


class FakeDateTime(datetime):
    """Return a fixed datetime for deterministic tests."""

    fixed_now = datetime(2025, 1, 2, tzinfo=timezone.utc)

    @classmethod
    def now(cls, tz=None):
        if tz is None:
            return cls.fixed_now.replace(tzinfo=None)
        return cls.fixed_now.astimezone(tz)


class DummyStore:
    def __init__(self, state):
        self.state = state
        self.saved_payload = None

    def load(self):
        return self.state

    def save(self, payload):
        self.saved_payload = payload
        self.state = payload


class DummyExchange:
    def __init__(self, fills):
        self.fills = fills
        self.calls = []

    def list_fills(self, limit, start_time):
        self.calls.append(SimpleNamespace(limit=limit, start_time=start_time))
        return list(self.fills)


@pytest.fixture
def fixed_datetime(monkeypatch):
    monkeypatch.setattr(rp, "datetime", FakeDateTime)
    return FakeDateTime.fixed_now


def _build_fill(product_id, price, size, side, trade_time, commission="0"):
    return {
        "product_id": product_id,
        "price": price,
        "size": size,
        "side": side,
        "trade_time": trade_time,
        "commission": commission,
    }


def test_rebuild_positions_updates_and_prunes_positions(monkeypatch, fixed_datetime):
    fills = [
        _build_fill("BONK-USD", "0.000020", "1000", "BUY", "2025-01-01T00:00:00Z", "0.00010"),
        _build_fill("BONK-USD", "0.000025", "500", "SELL", "2025-01-01T01:00:00Z", "0.00005"),
        _build_fill("SOL-USD", "100.0", "1", "BUY", "2025-01-01T00:30:00Z"),
        _build_fill("SOL-USD", "102.0", "1", "SELL", "2025-01-01T01:30:00Z"),
    ]

    dummy_exchange = DummyExchange(fills)
    monkeypatch.setattr(rp, "CoinbaseExchange", lambda read_only=True: dummy_exchange)

    initial_state = {
        "positions": {
            "SOL-USD": {"quantity": 1.0},
            "DOGE-USD": {"quantity": 5.0},
        }
    }
    store = DummyStore(initial_state)
    monkeypatch.setattr(rp, "get_state_store", lambda state_file=None: store)

    summary = rp.rebuild_positions(hours=48, state_file=None, dry_run=False)

    assert summary["positions_updated"] == 1
    assert summary["positions_removed"] == 1

    positions = store.state["positions"]
    assert "SOL-USD" not in positions  # closed via net-zero fills
    assert "DOGE-USD" in positions  # untouched

    bonk = positions["BONK-USD"]
    assert pytest.approx(bonk["base_qty"], rel=1e-6) == 500.0
    assert pytest.approx(bonk["entry_price"], rel=1e-6) == 0.00002
    assert pytest.approx(bonk["entry_value_usd"], rel=1e-6) == 0.01
    assert pytest.approx(bonk["usd_value"], rel=1e-6) == 0.0125
    assert pytest.approx(bonk["last_fill_price"], rel=1e-6) == 0.000025
    assert bonk["fees_paid"] == pytest.approx(0.00015)
    assert bonk["last_fill_time"] == "2025-01-01T01:00:00+00:00"
    assert "entry_time" in bonk
    assert store.saved_payload is not None


def test_rebuild_positions_dry_run_returns_preview(monkeypatch, fixed_datetime):
    fills = [_build_fill("ADA-USD", "0.50", "10", "BUY", "2025-01-01T02:00:00Z")]

    dummy_exchange = DummyExchange(fills)
    monkeypatch.setattr(rp, "CoinbaseExchange", lambda read_only=True: dummy_exchange)

    store = DummyStore({"positions": {}})
    monkeypatch.setattr(rp, "get_state_store", lambda state_file=None: store)

    summary = rp.rebuild_positions(hours=24, state_file=None, dry_run=True)

    assert summary["positions_updated"] == 1
    assert summary["positions_removed"] == 0
    assert "state_preview" in summary
    assert store.saved_payload is None  # no persistence in dry-run
